	var searchbox         = document.querySelector('header input'),
      results           = document.querySelector('#search-results'),
      header            = document.querySelector('header'),
      searchResultClass = 'has-search-results',
      listeners         = {},
      self              = this,
      testing, animationInterval, forwardButton, backButton, currentBatch;

  function on(event, fn, scope) {

    var l = listeners;

    l[event] = l[event] || [];

    l[event].push(arguments);

  }

  function fire(event, eventFacade, scope) {

    var l = listeners;

    if (l[event]) {
      l[event].forEach(function(subscription) {
        scope = subscription[2] || scope;
        subscription[1](eventFacade);
      });
    }

  }

  function QueuedElementList(rootSelector, options) {

    var optionsInternal = {},
        rootElement;

    this.listeners;

    //
    // Private methods
    //

    function init() {

      //
      // Set defaults
      //
      optionsInternal.queue     = options.queue     || [];
      optionsInternal.template  = options.template  || '',
      optionsInternal.batchSize = options.batchSize || 10;

      //
      // Select element
      //
      rootElement = document.querySelector(rootSelector);

    }

    function getNextBatch() {

      var batch = [];

      for (var i=0; optionsInternal.batchSize > i && optionsInternal.queue.length > 0; i++) {

        batch.push(optionsInternal.queue.shift());

      }

      currentBatch = batch;
      return batch;

    }

    function writeNextBatch() {

      var fragment;

      getNextBatch().forEach(function(item) {
        fragment = processTemplate(optionsInternal.template, item);
        $(rootElement).append(fragment);
      });

      fire('writeBatch', optionsInternal);

      return rootElement;

    }

    function processTemplate(template, data) {

      Object.keys(data).forEach(function(key) {

        template = template.split('{' + key + '}').join(data[key]);

      });

      return template;

    }

    //
    // Initialize!
    //
    init();

    return {
      writeNextBatch : writeNextBatch,
      on : on
    }

  }

  window.STMN.QueuedElementList = QueuedElementList;

  function Carousel(rootSelector, options) {

    options = options || {};

    var rootElement     = document.querySelector(rootSelector),
        coverPhotos,
        optionsInternal = {};

    rootElement.style.backgroundImage = 'url(/style/loader.gif)';
    rootElement.style.backgroundRepeat = 'no-repeat';
    rootElement.style.backgroundPosition = 'center';

    optionsInternal.slideClass = options.slideClass || 'carousel-slide';

    coverPhotos = $(rootSelector + ' .' + optionsInternal.slideClass);

    if(!rootSelector || !rootElement) {
      return false;
    }

    function goForward() {

      if (animationInterval) {
        clearInterval(animationInterval);
        animationInterval = null;
      }

      var start = rootElement.scrollLeft,
          last  = 0, pos, next;

      if (options.snapToSlide) {
        coverPhotos = $(rootSelector + ' .' + optionsInternal.slideClass);
        next = Math.round(rootElement.scrollLeft/coverPhotos[0].offsetWidth)+1;
        pos = (coverPhotos[next]) ? coverPhotos[next].offsetLeft : start;
      } else {
        pos = start + rootElement.offsetWidth;
      }

      $(rootElement).animate({'scrollLeft':pos}, null, null, function() {
        
        fire('forward', {
          target : rootElement
        });
      });

    }

    function goBackward() {

      if (animationInterval) {
        clearInterval(animationInterval);
        animationInterval = null;
      }

      var start = rootElement.scrollLeft,
          last  = 0, pos, next;

      if (options.snapToSlide) {
        coverPhotos = $(rootSelector + ' .' + optionsInternal.slideClass);
        next = Math.round(rootElement.scrollLeft/coverPhotos[0].offsetWidth)-1;
        pos = (coverPhotos[next]) ? coverPhotos[next].offsetLeft : start;
      } else {
        pos = start - rootElement.offsetWidth;
      }

      $(rootElement).animate({'scrollLeft':start - (rootElement.offsetWidth)}, null, null, function() {
        fire('backward', {
          target : rootElement
        });
      });

    }

    //
    // Add root element class
    //
    rootElement.classList.add('stmn-carousel-module');

    //
    // Set scroll style
    //
    rootElement.style.overflow  = 'hidden';
    rootElement.style.overflowX = 'scroll';
    rootElement.style.position  = 'relative';


    return {
      goForward  : goForward,
      goBackward : goBackward,
      on         : on
    }

  }

  window.STMN.Carousel = Carousel;

  function debounce(fn, delay) {
    var timer = null;
    return function () {
      var context = this, args = arguments;
      clearTimeout(timer);
      timer = setTimeout(function () {
        fn.apply(context, args);
      }, delay);
    };
  }

  function exitSearch() {

    searchbox.value = '';
    header.classList.remove('has-search-results');
    results.innerHTML = '';
  }

  searchbox.addEventListener('keyup', debounce(function(e) {

    var found;

    //
    // ESCAPE!!!
    //
    if (e.keyCode === 27) {
      exitSearch();
    }

    //
    // Is it a keydown? Go to the menu
    //
    if (e.keyIdentifier == 'Down' && header.classList.contains('has-search-results')) {

      results.querySelector('a').focus();

      return true;

    }

    //
    // Do a search suggestion
    //
    if (!testing) {

      results.innerHTML = '';
      testing = true;

      search_data.forEach(function(park, i) {

        if (e.target.value.length > 3 && new RegExp('.*'+e.target.value.toLowerCase()+'.*').test(park.park_name.toLowerCase())) {

          found = true;
          results.style.left = (searchbox.parentNode.offsetLeft + searchbox.offsetLeft + 10) + 'px';

          results.innerHTML += '<div><a href="/park/'+park.id+'" data-resultid="'+i+'">'+park.park_name+'</a></div>';

        }

      });

      if (found) {
        header.classList.add('has-search-results');
      } else {
        header.classList.remove('has-search-results');
      }

      testing = null;

    }

  },250), false);

  results.addEventListener('keyup', debounce(function(e) {

    var links;

    //
    // ESCAPE!!!
    //
    if (e.keyCode === 27) {
      exitSearch();
    }

    //
    // Down means go down the list
    //
    if (e.keyIdentifier == 'Down' && header.classList.contains('has-search-results')) {

      if (e.target.parentNode && e.target.parentNode.nextSibling) {
        e.target.parentNode.nextSibling.querySelector('a').focus();
      }

    }

    //
    // Up means go up the list
    //
    if (e.keyIdentifier == 'Up' && header.classList.contains('has-search-results')) {

      if (e.target.parentNode && e.target.parentNode.previousSibling) {
        e.target.parentNode.previousSibling.querySelector('a').focus();
      }

    }

  },250), false);

